import React from 'react';
import './main.css';
import Nav from './nav';
import { NavigationProvider } from './navigationContext';

const Navigate = ({ children, href }) => {
  return (
    <a
      onClick={event => {
        event.preventDefault();
        event.stopPropagation();
        setNavigation();
      }}
      href={href}
    >
      {children}
    </a>
  );
};

export default Navigate;
